import React, { useState } from 'react';
import { Button, Modal } from 'react-bootstrap';

const ModalListUser = () => {
  const [showModal, setShowModal] = useState(false);

  const handleModalOpen = () => {
    setShowModal(true);
  };

  const handleModalClose = () => {
    setShowModal(false);
  };

  const handleConfirm = () => {
    // Acciones cuando se hace clic en el botón de confirmación
    setShowModal(false);
    // Realiza las acciones necesarias para confirmar
  };

  const handleCancel = () => {
    // Acciones cuando se hace clic en el botón de cancelación
    setShowModal(false);
    // Realiza las acciones necesarias para cancelar
  };

  return (
    <div>
      <Button variant="primary" onClick={handleModalOpen}>
        Open Modal
      </Button>

      <Modal show={showModal} onHide={handleModalClose}>
        <Modal.Header closeButton>
          <Modal.Title>Are you sure?</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>You won't be able to revert this!</p>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="danger" onClick={handleCancel}>
            No, cancel!
          </Button>
          <Button variant="success" onClick={handleConfirm}>
            Yes, delete it!
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default ModalListUser;
